import styled from "styled-components";

export const MainHeader = styled.header`
  background: #fff;
  height: 72px;
  border-bottom: 1px solid #ddd;
`;

export const HeaderContent = styled.header`
  width: 100%;
  max-width: 70%;
  margin: 0 auto;
  padding: 0px 30px;
`;

export const Logo = styled.img``;
